import React, {Component} from 'react';
import './ShopDetails.scss';
import {NavLink,Switch,Route,Router} from "react-router-dom";
import Useraction from "./useraction";
import Layout from "./layout2";
import Order from "./order";
import Evaluate from "./evaluate";
import Merchant from "./merchant";
class ShopDetails extends Component {
    render() {
        return (
            <div className="shopDetails">
                {/*1、头部*/}
                <div className="head">
                    <img src={require("../../../static/img/ShopDetails/fff.webp")} alt="shoplogo"/>
                    
                </div>
                {/*2、标题部分*/}
                <div className="title">
                    {/*2.1名称*/}
                    <h2>东池便当(高新店)<span className="iconfont icon-youla"></span></h2>
                    {/*2.2分数*/}
                    <div className="cont">
                        <span>评分4.9</span>
                        <span>月售509单</span>
                        <span>蜂鸟转送24分钟</span>
                    </div>
                    {/*2.3优惠*/}
                    <div className="preferential">
                        <div className="mreduce">
                            <span className="reduce">满减</span>
                            <span>满10减8</span>
                            <span>满35减15</span>
                            <span>满88减40</span>
                        </div>
                        <div className="morepreferential">15个优惠<span className="iconfont icon-xiala1"></span></div>
                    </div>
                    {/*2.4公告*/}

                    <div className="notice">
                        公告：风行台湾的盒餐，原滋原味呈现！
                    </div>

                </div>
                {/*3分类区块:用户选择*/}
                <div className="userList">
                    <NavLink exact activeClassName="active" to="/food/ShopDetails">点餐</NavLink>
                    <NavLink activeClassName="active" to="/food/evaluate">评价</NavLink>
                    <NavLink activeClassName="active" to="/food/merchant">商家</NavLink>
                </div>
                <Layout>

                    <Route path="/food/ShopDetails" component={Order}></Route>
                    {/*<Route exact path="/food/evaluate" component={Order}></Route>*/}
                    {/*<Route path="/food/evaluate" component={Evaluate}></Route>*/}
                    {/*<Route path="/food/merchant" component={Merchant}></Route>*/}

                </Layout>

            </div>
        );
    }
}

export default ShopDetails ;
